  KEY `added_by` (`added_by`),
  CONSTRAINT `tbl_4_rent_ibfk_2` FOREIGN KEY (`added_by`) REFERENCES `tbl_admin` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=254 DEFAULT CHARSET=latin1;

